import tensorflow as tf
from tensorflow import keras
from tensorflow.keras import layers
import numpy as np
import matplotlib.pyplot as plt

IMG_SIZE = (224, 224)  # same as training
preprocess = keras.applications.efficientnet_v2.preprocess_input

def _find_backbone(model):
    # Try common names first, including your case with hyphen
    for name in [
        "efficientnetv2-b0", "efficientnetv2-s", "efficientnetb0",
        "resnet50v2", "convnexttiny"
    ]:
        try:
            return model.get_layer(name)
        except Exception:
            pass
    # Fallback: first nested Model/Functional whose output is 4D
    for layer in model.layers:
        if isinstance(layer, (keras.Model, keras.layers.Layer)) and hasattr(layer, "output"):
            try:
                if len(layer.output.shape) == 4:
                    return layer
            except Exception:
                continue
    raise ValueError("Backbone not found. Print model.summary() and adjust the name.")

def build_gradcam_model(trained_model):
    """
    Build a clean CAM graph:
      inp -> preprocess -> backbone -> conv_feats
                          conv_feats -> GAP -> Dropout -> Dense -> preds
    Gradients are taken w.r.t. conv_feats (last conv feature map).
    """
    backbone = _find_backbone(trained_model)
    gap   = trained_model.get_layer("global_average_pooling2d")
    drop  = trained_model.get_layer("dropout")
    dense = trained_model.get_layer("dense")

    inp = keras.Input(shape=(*IMG_SIZE, 3), name="cam_input")
    x = preprocess(inp)                            # skip augmentation for CAM
    # Use the backbone's own internal graph correctly by making a "through" model
    back_through = keras.Model(backbone.input, backbone.output, name="backbone_through")
    conv_feats = back_through(x, training=False)   # (H, W, C) last conv feature map

    x = gap(conv_feats)
    x = drop(x, training=False)
    preds = dense(x)

    # Model outputs both conv feature map and final predictions
    cam_model = keras.Model(inputs=inp, outputs=[conv_feats, preds], name="cam_model")
    return cam_model

cam_model = build_gradcam_model(best)

def gradcam(img_uint8, cam_model):
    x = tf.cast(img_uint8[None, ...], tf.float32)
    with tf.GradientTape() as tape:
        conv_out, preds = cam_model(x, training=False)   # conv_out: (1,H,W,C)
        class_idx = tf.argmax(preds[0])
        loss = preds[:, class_idx]
    grads = tape.gradient(loss, conv_out)[0]             # (H,W,C)
    weights = tf.reduce_mean(grads, axis=(0, 1))         # (C,)
    cam = tf.reduce_sum(weights * conv_out[0], axis=-1)  # (H,W)
    cam = tf.nn.relu(cam)
    cam = cam / (tf.reduce_max(cam) + 1e-8)
    cam = tf.image.resize(cam[..., None], (img_uint8.shape[0], img_uint8.shape[1]))
    return cam.numpy().squeeze(), int(class_idx.numpy())

import random
