for i, idx in enumerate(idxs):
    img = batch_images[idx].numpy().astype("uint8")
    cam, pred_id = gradcam(img, cam_model)
    ax = plt.subplot(3,4,i+1)
    ax.imshow(img, alpha=0.6); ax.imshow(cam, alpha=0.4, cmap="jet")
    ax.set_title(class_names[pred_id], fontsize=9); ax.axis("off")
plt.tight_layout(); plt.show()



