import io, numpy as np
import gradio as gr
from PIL import Image
import matplotlib.pyplot as plt
from matplotlib import cm
import tensorflow as tf
from tensorflow import keras

# ---------- Helpers ----------
def pil_to_uint8(img_pil, size):
    img = img_pil.convert("RGB").resize(size, Image.BILINEAR)
    return np.array(img, dtype=np.uint8)

def make_overlay(img_uint8, cam_01, alpha=0.45):
    """img_uint8: (H,W,3) uint8, cam_01: (H,W) float in [0,1]"""
    # colorize heatmap
    heat = (cm.get_cmap("jet")(cam_01)[..., :3] * 255).astype(np.uint8)
    # alpha blend
    over = (alpha * heat + (1 - alpha) * img_uint8).astype(np.uint8)
    return over

# Grad-CAM function from the previous cell (expects cam_model built already)
def gradcam_uint8(img_uint8):
    x = tf.cast(img_uint8[None, ...], tf.float32)
    with tf.GradientTape() as tape:
        conv_out, preds = cam_model(x, training=False)     # conv_out: (1,H,W,C)
        class_idx = tf.argmax(preds[0])
        loss = preds[:, class_idx]
    grads = tape.gradient(loss, conv_out)[0]               # (H,W,C)
    weights = tf.reduce_mean(grads, axis=(0, 1))           # (C,)
    cam = tf.reduce_sum(weights * conv_out[0], axis=-1).numpy()
    cam = np.maximum(cam, 0)
    cam = cam / (cam.max() + 1e-8)
    # resize CAM to input size
    cam = tf.image.resize(cam[..., None], IMG_SIZE).numpy().squeeze()
    return cam, int(class_idx.numpy()), preds.numpy()[0]

# Pretty names (optional): strip numeric prefixes like '01-minor'
pretty_names = [c.split('-', 1)[-1] if '-' in c else c for c in class_names]

def infer(pil_img: Image.Image):
    # 1) prepare uint8 input
    img_uint8 = pil_to_uint8(pil_img, IMG_SIZE)

    # 2) run Grad-CAM + prediction
    cam, pred_id, probs = gradcam_uint8(img_uint8)

    # 3) blend overlay
    overlay = make_overlay(img_uint8, cam, alpha=0.45)

    # 4) build Gradio label dict (class->prob)
    prob_dict = {pretty_names[i]: float(probs[i]) for i in range(len(class_names))}
    return prob_dict, overlay

# ---------- UI ----------
with gr.Blocks(title="Car Damage Severity  TF/Keras + Grad-CAM") as demo:
    gr.Markdown("## Car Damage Severity Classifier\nUpload a car-damage photo to see the prediction and Grad-CAM focus.")
    with gr.Row():
        inp = gr.Image(type="pil", label="Upload image", height=300)
        with gr.Column():
            lbl = gr.Label(num_top_classes=len(class_names), label="Predicted probabilities")
            viz = gr.Image(type="numpy", label="Grad-CAM overlay", height=300)
    btn = gr.Button("Predict", variant="primary")
    btn.click(fn=infer, inputs=inp, outputs=[lbl, viz])

demo.launch(share=True, debug=False)
